MongoDB | Listing the Zip Code/Postal Code for each City in New York<p>I am learning how to write MongoDB queries as part of my personal project. I think I am missing something small or big (I don't know), and hoping that someone could point to what is wrong with my MongoDB query. I am working on the popular zip code data set that is provided on MongoDB here: <a href="https://docs.mongodb.com/manual/tutorial/aggregation-zip-code-data-set/" rel="nofollow noreferrer">https://docs.mongodb.com/manual/tutorial/aggregation-zip-code-data-set/</a></p>
<p>An example of a document in the zipcodes collection has the following form:</p>
<pre><code>{
  &quot;_id&quot;: &quot;10280&quot;,
  &quot;city&quot;: &quot;NEW YORK&quot;,
  &quot;state&quot;: &quot;NY&quot;,
  &quot;pop&quot;: 5574,
  &quot;loc&quot;: [
    -74.016323,
    40.710537
  ]
}
</code></pre>
<p><strong>Goal:</strong> I am trying to find the population of each city in the state of New York (NY) where the results list the postal codes that are included in <strong>each</strong> city. The output should look something like this:</p>
<pre><code>{
    _id : &quot;ELMIRA&quot;,
    population : &lt;population of ELMIRA&gt;,
    postal_codes : [
        &lt;PostalCode1 in ELMIRE&gt;,
        &lt;PostalCode2 in ELMIRE&gt;,
        &lt;PostalCode3 in ELMIRA&gt;
        ]
    },
    {
        _id : &quot;WHITESVILLE&quot;,
        population : &lt;population of WHITESVILLE&gt;,
        postal_codes : [
            &lt;PostalCode1 in WHITESVILLE&gt;
        ]
    },
</code></pre>
<p><strong>My Code</strong>: Here is what I have written so far</p>
<pre><code>db.getCollection('codes').aggregate([
    { 
        $group: {
            _id: {city: &quot;$city&quot;, state:&quot;$state&quot;},
            population: {$sum: &quot;$pop&quot;},
            postal_codes: {$addToSet: &quot;$_id&quot;}
        }
    },
    {
        $match: {
            &quot;_id.state&quot;:&quot;NY&quot;

        }

    },
    {
        $group: {
            _id: &quot;$_id.city&quot;,
            population: {$last: &quot;$population&quot;},
            postal_codes: {$last: &quot;$postal_codes&quot;}
        }
    }       
])
</code></pre>
<p><strong>Problem</strong> - The issue that I see with my code is that it only lists <em>one</em> of the zip codes for a city in New York that has multiple zip codes, as shown below. In the U.S., a city may overlap several postal codes. How can I fix my query to include <em>all</em> zip codes for each city in New York instead of one of them?</p>
<pre><code>{ 
    &quot;_id&quot; : &quot;OSSINING&quot;, 
    &quot;population&quot; : NumberInt(29926), 
    &quot;postal_codes&quot; : [
        &quot;10562&quot;
    ]
}
{ 
    &quot;_id&quot; : &quot;COLD SPRING&quot;, 
    &quot;population&quot; : NumberInt(4904), 
    &quot;postal_codes&quot; : [
        &quot;10516&quot;
    ]
}
{ 
    &quot;_id&quot; : &quot;NORTH WOODMERE&quot;, 
    &quot;population&quot; : NumberInt(19582), 
    &quot;postal_codes&quot; : [
        &quot;11581&quot;
    ]
}
</code></pre>

