Group documents with MongoDB<p>I come from the world of relational databases and am having difficulty with a MongoDB query.</p>
<p>In my database I have telemetry documents with minute-by-minute records for each monitored system.</p>
<p>I'm tending to do a query that groups records by hour.</p>
<p><strong>Below is a demonstration of the structure of my documents:</strong></p>
<pre><code>{
  _id: ObjectId(&quot;61847b83618fc8a6fb368ab7&quot;),
  system_code: 22,
  date: ISODate(&quot;2021-08-01T00:00:01.000Z&quot;),
  value1: 22.2372973251,
  value2: 20
}
</code></pre>
<p><strong>Here's the structure of the query I'm trying to run:</strong></p>
<pre><code>db.telemetry.aggregate([
    {
        $match: {
            $and: [
                { system_code: 22 },
                { date: { $gte: ISODate(&quot;2021-08-01 00:00:00&quot;) } },
                { date: { $lte: ISODate(&quot;2021-08-01 02:00:00&quot;) } }
            ]
        }
    },
    {
        $addFields: {
            italianDate: {
                $dateToString: {
                    format: &quot;%d/%m/%Y %H:00:00&quot;,
                    date: &quot;$date&quot;
                }
            }
        }
    },
    {
        $sort: {
            italianDate: 1
        }
    },
    {
        $group: {
            _id: {
                year: { $year: &quot;$date&quot; },
                month: { $month: &quot;$date&quot; },
                day: { $dayOfMonth: &quot;$date&quot; },
                hour: { $hour: &quot;$date&quot; }
            }
        }
    }
]);
</code></pre>
<p><strong>The SQL query with PostgreSQL is exactly this:</strong></p>
<p><code>SELECT TO_CHAR(t.date, 'YYYY-MM-DD HH24:00:00') AS italianDate, AVG(value1), AVG(value2) FROM telemetry t WHERE t.system_code = 22 AND t.date BETWEEN '2021-08-01 00:00:00' AND '2021-08-01 02:00:00' GROUP BY italianDate ORDER BY italianDate ASC</code></p>
<p><strong>Thank you so much if you can help me.</strong></p>

