<pre><code>{ &quot;_id&quot; : 1, &quot;name&quot; : &quot;Dev&quot; }
{ &quot;_id&quot; : 2, &quot;name&quot; : &quot;Eliot&quot;, &quot;parentId&quot; : 1 }
{ &quot;_id&quot; : 3, &quot;name&quot; : &quot;Ron&quot;, &quot;parentId&quot; : 2 }
{ &quot;_id&quot; : 4, &quot;name&quot; : &quot;Andrew&quot;, &quot;parentId&quot; : 2 }
{ &quot;_id&quot; : 5, &quot;name&quot; : &quot;Asya&quot;, &quot;parentId&quot; : 3 }
{ &quot;_id&quot; : 6, &quot;name&quot; : &quot;Dan&quot;, &quot;parentId&quot; : 4 }
</code></pre>
<p>And I can use &quot;$graphLookup&quot; to get children and parents.<bR></p>
<pre><code>db.xmantree.aggregate( [
   {
      name: &quot;Eliot&quot;
   },
   {
      $graphLookup: {
          from: 'xmantree',
          startWith: '$_id',
          connectFromField: 'parentId',
          connectToField: 'parentId',
          as: 'children'
       }
   },
  {
      $graphLookup: {
          from: 'xmantree',
          startWith: '$parentId',
          connectFromField: 'parentId',
          connectToField: '_id',
          as: 'parents'
       }
   }
] )
</code></pre>
<p>The result is this.</p>
<pre><code>{
    _id:2,
    name: &quot;Eliot&quot;,
    parentId: 1,
    children: [
        {
            _id: 3,
            name: &quot;Ron&quot;,
            parentId: 2,
        },
        {
            _id: 4,
            name: &quot;Andrew&quot;,
            parentId: 2,
        },
    ],
    parents: [
        {
            _id: 1,
            name: &quot;Dev&quot;
        }
    ]
}
</code></pre>
<p>But Each of Ron and Andrew has more children in this case. So I want to get this recursively by one query of aggregate. <br>
For example, this kind of result.</p>
<pre><code>{
    _id:2,
    name: &quot;Eliot&quot;,
    parentId: 1,
    children: [
        {
